<?php $__env->startSection('content'); ?><p>Kim Kardashian shut down rumours of an impending divorce from her husband Kanye West on Saturday, as the pair reunited to attend their friends' wedding.</p>

<p>The 39-year-old TV personality took to her Instagram Stories to share snaps and footage from the romantic backyard celebration.</p>

<p>And as she shared details from the nuptials, including a snap of herself enjoying a 'rare' cocktail', the mother-of-four posted in an image of her and 43-year-old Kanye's footwear, adding the caption: 'Date night.'</p>

<p>Date night: Kim Kardashian shut down rumours of an impending divorce from her husband Kanye West on Saturday, as the pair reunited to attend their friends' wedding </p>

<p>The pair's loved-up outing firmly put to bed renewed rumours that Kim was on the verge of filing for divorce from her husband of six years.</p>

<p>Kim didn't show her famous husband's face while sharing footage from the outdoor gathering, with only his shoes making a cameo in the social media uploads.</p>

<p>Throughout the night, the reality star jammed to some Frank Sinatra and indulged in a decadent gourmet meal.</p>

