<p>'It's a rare night that I have a drink,' wrote Kardashian as she documented the entire celebration on her Instagram Story.</p>

<p>First, she captured a picture of her first delicious drink for the night, which was a deep shade of pink and featured a citrus garnish. </p>

<p>The snapshot also showcased Kim's black espadrille inspired heels and her iridescent designer handbag.</p>

<p>In a follow up photo, the KKW Beauty founder placed her drink on the ground and posed next to her musician-turned-designer husband Kanye. </p>

