<p>There were a plethora of potted flowers strewn about and each wooden dining table was nearly set and covered in pink and yellow arrangements.</p>

<p>Kim made sure to take a snapshot of the bride and groom as they exchanged vows.</p>

<p>Once the ceremony completed and the sun set, Kim and the rest of the wedding attendees headed to the reception.</p>

<p>'Guess I need it!' captioned Kim on one post where she looks to be sipping on a glass of white wine. </p>

