<p>She then took a brief video of the various flower arrangements as Frank Sinatra played in the background.</p>

<p>To close out her lengthy Instagram Story, the mother of four gave her 189million followers a look at the delicious dish she was deserved. 'Sweet corn pasta is my absolutely fav pasta,' she wrote.  </p>

<p>Earlier in the day, Kim's husband Kanye took to his Twitter page to share some footage from a local celebration during his recently-concluded trip to Haiti.  </p>

