<p>Kanye had previously spent some time in nearby Jamaica before flying over to Haiti.</p>

<p>The rapper landed at Hugo Chávez International Airport in Cap-Haïtien in the country's northern area, where he ran into tennis star Naomi Osaka, the Miami Herald reported.</p>

<p>He was met there by President Jovenel Moise, who gave him a tour of the island.</p>

<p>Kanye was pictured in Instagram videos enjoying the music and dancing at one celebrating, though it wasn't clear if it was thrown in his honor.</p>

