<p>The Monster rapper didn't mention his reasons for visiting Haiti, but he did share twitter posts on Saturday indicating he was interested in the country because of its history of overthrowing French colonialists. </p>

<p>'Haiti is where our people started the first revolution that freed us from slavery,' he wrote in one tweet that included a paint of Haitians battling the French.</p>

<p>Shortly afterward, he posted another tweet with a photo of his own showing a crowd of people gawking at him.</p>

